import { Card } from 'react-bootstrap';

export default function Produto(props) {
    return (
        <Card className={props.categoria} onMouseMove="mousedentro(this)" onMouseOut="mousefora(this)">
            <Card.Img variant="top" src= {require(`../img/${prop.imagem}`).default} alt ="Imagem do produto" />
            <Card.Body>

            </Card.Body>
        </Card>
    )
}
